.custom-legend {

// Create a logarithmic scale for the GDP values
const colorScale = d3.scaleLinear([0, 1]);
    

// Define color interpolations for each part of the scale
function getColor(gdp) {
    const logScaleValue = colorScale(gdp); // Apply the log scale to the GDP value
    
    // If the value is around the midpoint (log scale), we want it to be white
    const midValue = 0.5; // Midpoint of the log scale (this is the 'middle' color)
    
    if (logScaleValue < midValue) {
        // Interpolating from #f79458 to white for the lower half
        return d3.interpolateRgb("#f79458", "#ffffff")(logScaleValue / midValue);
    } else {
        // Interpolating from white to #28cc46 for the upper half
        return d3.interpolateRgb("#ffffff", "#28cc46")((logScaleValue - midValue) / (1 - midValue));
    }
}
// Set initial year (default to 2019)
let selectedYear = '2019';

// Function to update layer styles based on the selected year
function updateLayerStyles() {
    // Update the style of each layer based on the selected year
    countiesLayer.setStyle(styleRlh);
    countiesLayer2.setStyle(styleAml);
    countiesLayer3.setStyle(styleSl);
    countiesLayer4.setStyle(styleLhl);
    countiesLayer5.setStyle(styleKl);
    // Re-bind the tooltips after the year changes
    updateTooltips();
}

// Event listener for year dropdown change
document.getElementById('yearDropdown').addEventListener('change', function(event) {
    selectedYear = event.target.value; // Get the selected year (e.g., '2019', '2020', etc.)
    updateLayerStyles(); // Refresh all layers with the selected year
});

// Function to update the tooltips for all layers
function updateTooltips() {
    // Re-bind tooltips for each feature in each layer
    countiesLayer.eachLayer(function(layer) {
        layer.unbindTooltip(); // Remove existing tooltip
        layer.bindTooltip(getTooltipContent(layer.feature, 'rlh')); // Re-bind with updated tooltip content
    });
    countiesLayer2.eachLayer(function(layer) {
        layer.unbindTooltip(); // Remove existing tooltip
        layer.bindTooltip(getTooltipContent(layer.feature, 'aml')); // Re-bind with updated tooltip content
    });
    countiesLayer3.eachLayer(function(layer) {
        layer.unbindTooltip(); // Remove existing tooltip
        layer.bindTooltip(getTooltipContent(layer.feature, 'sl')); // Re-bind with updated tooltip content
    });
    countiesLayer4.eachLayer(function(layer) {
        layer.unbindTooltip(); // Remove existing tooltip
        layer.bindTooltip(getTooltipContent(layer.feature, 'lhl')); // Re-bind with updated tooltip content
    });
    countiesLayer5.eachLayer(function(layer) {
        layer.unbindTooltip(); // Remove existing tooltip
        layer.bindTooltip(getTooltipContent(layer.feature, 'kl')); // Re-bind with updated tooltip content
    });
}

// Function to generate tooltip content dynamically based on the feature and indicator
function getTooltipContent(feature, indicator) {
    const year = selectedYear; // Use selectedYear directly
    const propertyName = `${indicator}_${year}`; // Construct property name dynamically
    const value = feature.properties[propertyName]; // Get the value for the selected year

    if (value === undefined || isNaN(value)) {
        return `<div class="custom-tooltip">
                    <div class="tooltip-circle" style="background-color: gray;"></div>
                    <div class="tooltip-text">
                        <strong>${getIndicatorName(indicator)} Tahun ${year}</strong><br>
                        ${feature.properties.provinsi}, ${feature.properties.nama}, N/A
                    </div>
                </div>`;
    }

    const fillColor = getColor(value); // Use getColor to calculate fill color dynamically
    return `<div class="custom-tooltip">
                <div class="tooltip-circle" style="background-color: ${fillColor};"></div>
                <div class="tooltip-text">
                    <strong>${getIndicatorName(indicator)} Tahun ${year}</strong><br>
                    ${feature.properties.provinsi}, ${feature.properties.nama}, ${(value * 100).toLocaleString()}%
                </div>
            </div>`;
}

// Function to get the indicator name dynamically based on the indicator code
function getIndicatorName(indicator) {
    const indicatorNames = {
        'rlh': 'Persentase Rumah Layak Huni',
        'aml': 'Persentase Rumah dengan Air Minum Layak',
        'sl': 'Persentase Rumah dengan Sanitasi Layak',
        'lhl': 'Persentase Rumah dengan Luas Hunian Layak',
        'kl': 'Persentase Rumah dengan Konstruksi Layak'
    };
    return indicatorNames[indicator] || 'Unknown Indicator';
}

// Define style functions to handle the selected year dynamically
function styleRlh(feature) {
    return {

// Function to handle mouseover event (when cursor hovers over polygon)
function highlightFeature(e) {
    const layer = e.target;
    layer.setStyle({
        fillColor: '#b3edbe', // Increase the opacity on hover
    });
}

// Function to handle mouseout event (when cursor leaves polygon)
function resetHighlight(e) {
    geojson.resetStyle(e.target); // Reset to original style
}

// Add counties layer
const countiesLayer = L.geoJSON(countiesGeoJSON, {
    style: styleRlh,
    onEachFeature: function (feature, layer) {
        if (feature.properties.rlh_2019 && feature.properties.provinsi && feature.properties.nama) {
            // Bind tooltip with styled content
            
            // Mouseover event to dynamically change tooltip styling
            layer.on({
                mouseover: function (e) {
                    const hoverColor = '#4287f5'; // Color to set on hover
                    layer.setStyle({ fillColor: hoverColor });
                    // Dynamically update tooltip circle color on hover
                    const tooltipCircle = document.querySelector('.tooltip-circle');
                    if (tooltipCircle) tooltipCircle.style.backgroundColor = hoverColor;
                },
                mouseout: function (e) {
                    countiesLayer.resetStyle(e.target); // Reset style
                }
            });
        }
    }
});

// Wrap the layers into a Layer Group
const layerGroups = [
  L.layerGroup([countiesLayer, countiesLineLayer]), // layerGroup1_Main
  L.layerGroup([countiesLayer2, countiesLineLayer]), // layerGroup2_Main
  L.layerGroup([countiesLayer3, countiesLineLayer]), // layerGroup3_Main
  L.layerGroup([countiesLayer4, countiesLineLayer]), // layerGroup4_Main

// Variable to track the active layer group index
let activeLayerGroupIndex = 0;

// Add the first Layer Group to the map by default
layerGroups[0].addTo(map);
// Initial call to bind tooltips on page load
updateTooltips();
document.addEventListener('DOMContentLoaded', () => {
  // Track active dataset
  let isDataSet1Active = true;

  // Elements for toggling the layers
  const migrationButton = document.getElementById('migrationButton');
  const accuracyButton = document.getElementById('accuracyButton');
  const accuracyButton2 = document.getElementById('accuracyButton2');
  const accuracyButton3 = document.getElementById('accuracyButton3');
  const accuracyButton4 = document.getElementById('accuracyButton4');

  // Define custom legend
  const customLegend = L.control({ position: 'bottomright' });

  customLegend.onAdd = function (map) {
    const div = L.DomUtil.create('div', 'custom-legend');
    div.innerHTML = `
        <div class="legend-title">Persentase Capaian Rumah Layak Huni Per Kabupaten/Kota</div>
        <div class="legend-gradient">
            <span class="gradient-label">0 %</span>
            <div class="gradient-bar"></div>
            <span class="gradient-label">100 %</span>
        </div>
        <div class="legend-description"> 
            Sumber Data: <a href="https://www.bps.go.id/id" target="_blank">Badan Pusat Statistik Indonesia</a><br> 
            * Memperlihatkan persentase Capaian Rumah Layak Huni per kabupaten/kota di Provinsi Jawa Tengah dan DIY
        </div>
    `;
    return div;
  };

  // Add the legend to the map
  customLegend.addTo(map);

  // Function to update only the title and description text in the legend
  function updateLegendContent(title, description) {
    const legendTitle = document.querySelector('.legend-title');
    const legendDescription = document.querySelector('.legend-description');
    if (legendTitle && legendDescription) {
      legendTitle.textContent = title;
      legendDescription.innerHTML = description;
    }
  }

  // Function to toggle the layers between multiple datasets
  function toggleLayers(targetIndex) {
    if (targetIndex === activeLayerGroupIndex) {
      // If the target is already active, do nothing
      return;
    }

    // Remove the currently active layer group
    layerGroups[activeLayerGroupIndex].removeFrom(map);

    // Add the target layer group
    layerGroups[targetIndex].addTo(map);

    // Update the active layer group index
    activeLayerGroupIndex = targetIndex;
  }

  // Function to update the active button state
  function updateButtonState(activeButton) {
    // Remove active class from all buttons
    const allButtons = document.querySelectorAll('.toggle-button');
    allButtons.forEach(button => button.classList.remove('active'));

    // Add active class to the clicked button
    activeButton.classList.add('active');
  }

  // Event listener for Rumah Layak Huni button
  migrationButton.addEventListener('click', () => {
    toggleLayers(0); // Activate layerGroup1_Main
    updateButtonState(migrationButton);
    updateLegendContent(
      'Persentase Capaian Rumah Layak Huni per Kabupaten/Kota',
      `Sumber Data: <a href="https://www.bps.go.id/id" target="_blank">Badan Pusat Statistik Indonesia</a><br> 
       * Memperlihatkan persentase Capaian Rumah Layak Huni per kabupaten/kota di Provinsi Jawa Tengah dan DIY`
    );
  });

  // Event listener for Air Minum Layak button
  accuracyButton.addEventListener('click', () => {
    toggleLayers(1); // Activate layerGroup2_Main
    updateButtonState(accuracyButton);
    updateLegendContent(
      'Persentase Capaian Rumah Dengan Air Minum Layak per Kabupaten/Kota',
      `Sumber Data: <a href="https://www.bps.go.id/id" target="_blank">Badan Pusat Statistik Indonesia</a><br> 
       * Memperlihatkan persentase capaian Rumah dengan Air Minum Layak per kabupaten/kota di Provinsi Jawa Tengah dan DIY`
    );
  });

  // Event listener for Sanitasi Layak button
  accuracyButton2.addEventListener('click', () => {
    toggleLayers(2); // Activate layerGroup3_Main
    updateButtonState(accuracyButton2);
    updateLegendContent(
      'Persentase Capaian Rumah dengan Sanitasi Layak per Kabupaten/Kota',

       * Memperlihatkan persentase capaian Rumah dengan Sanitasi Layak per kabupaten/kotadi Provinsi Jawa Tengah dan DIY`
    );
  });

  // Event listener for Luas Hunian Layak button
  accuracyButton3.addEventListener('click', () => {

       * Memperlihatkan persentase Rumah dengan Luas Hunian Layak per kabupaten/kota di Provinsi Jawa Tengah dan DIY`
    );
  });

  // Event listener for Konstruksi Layak button

       * Memperlihatkan persentase Rumah dengan Konstruksi Layak per kabupaten/kota di Provinsi Jawa Tengah dan DIY`
    );
  });
});
